import styled from "styled-components";

const OverlayStyled = styled.div`
display:flex
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background-color: rgba(0, 0, 0, 0.7);
  z-index: 2;
`;

export default OverlayStyled;
